package Lec1;

public class Arithmetic_Op {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 9;
		int b = 5;
		int c = a + b;
		System.out.println(c);
		c = a - b;
		System.out.println(c);
		int p = a / b;
		int s = a % b;
		System.out.println(p);
		System.out.println(s);
		int r = a * b;
		System.out.println(r);

	}

}
